- input: "TEXT\x1CC00489856\x1C.TEXT\x1C\x1CF3XA\x1CThe expenditure to American Media
    & Advocacy Group reported on November 2, 2012 in the amount of $427,510.00 is
    amended to $177,495.03 to reflect actual media placement amounts. This vendor
    was prepaid for media and it reported to the committee the amounts placed as they
    occurred for the purchase amount ordered.  However, actual placement of the entire
    amount was not able to be made and the adjustment in this amendment corrects to
    the total placement actually disseminated, as later reported to the committee.
    \ The amount originally reported was correct at the time of reporting based on
    all information available to the committee.\n"
